import React from 'react'
import Ratio from 'react-bootstrap/Ratio';
import "../Maplocation/Maplocation.css"

const Maplocation = () => {
  return (
    <div className='d-flex justify-content-md-center align-items-center mt-5'>
      <Ratio aspectRatio="4x3" style={{ width : '80%' , height: "500px"}}>
      <iframe 
      src="https://maps.google.com/maps?q=sukarame bandar lampung&t=&z=17&ie=UTF8&iwloc=&output=embed" frameborder="0" scrolling="no" marginheight="0" marginwidth="0"
      style={{ border: '1px ' }}
      >

      </iframe>
      </Ratio>
      <style jsx>{`
        .ratio {
          position: relative;
          height: 0;
          overflow: hidden;
          max-width: 100%;
        }
        .ratio iframe {
          position: absolute;
          top: 0;
          left: 0;
          width: 100%;
          height: 100%;
        }
        @media (max-width: 576px) {
          .ratio {
            padding-top: 56.25%;
          }
        }
      `}</style>
    </div>

  )

}
export default Maplocation;
